#!perl
use 5.20.1;
use warnings FATAL => 'all';
use experimental qw(signatures postderef);
use JSON::MaybeXS qw(decode_json encode_json);
use Data::Dumper qw(Dumper);

my $raw_units = do { local $/; <DATA> };
close DATA;
my $units = decode_json($raw_units);
open my $output_fh, '>', 'populate_unitdefs.sql';
say $output_fh 'BEGIN;';

my %side_mapping = (
    gb => 'gbr',
    us => 'us',
    it => 'ita',
    ge => 'ger',
    ru => 'rus',
    jp => 'jpn',
);

my $template = q|INSERT INTO unitdef (name, human_name, side, unitpic, description, health, ammo, armor, cost, available_in_shop) VALUES ('%s', '%s', '%s', '%s', '%s', %.0f, %s, %s, %d, '%s');|;
for my $side (keys $units->%*) {
    for my $unit ($units->{$side}->@*) {
        if ($unit->{armor_top}) {
            $unit->{armor} = "'" . encode_json({
                top => $unit->{armor_top},
                rear => $unit->{armor_rear},
                side => $unit->{armor_side},
                front => $unit->{armor_front}
            }) . "'";
        }

        # HACK HACK HACK
        $unit->{side} = $side_mapping{$unit->{side}};
        $unit->{armor} //= 'NULL';
        $unit->{ammo} //= 'NULL';
        $unit->{available_in_shop} //= 'false';
        $unit->{cost} //= 0;
        $unit->{human_name} //= $unit->{name};
        $unit->{description} //= $unit->{name};
        $unit->{unitpic} = lc($unit->{unitpic});
        if (!-f '../public/img/' . $unit->{unitpic}) {
            $unit->{unitpic} =~ s/\.png/_stationary.png/g;
        }

        say $output_fh sprintf($template, $unit->@{qw(name human_name side unitpic description health ammo armor cost available_in_shop)});
    }
}

say $output_fh "COMMIT;";

close $output_fh;

